def process_string(s):
    s = s.lower()
    freq_count = {}
    for char in s:
        if char not in freq_count:
            freq_count[char] += 1
        else:
            freq_count[char] = 1
    first_unique_char_index = next((index for (index, char) in enumerate(s) if freq_count[char] == 1), None)
    frequency_dist = sorted(freq_count.items())
    return {'first_unique_char_index': first_unique_char_index, 'frequency_dist': frequency_dist}

